@Override
public String[] listAvailableCurrencies() {
  List<String> pairs = new ArrayList<String>();
  for(String from : rates.keySet()) {
    for(String to : rates.get(from).keySet()) {
      pairs.add(from+","+to);
    }
  }
  return pairs.toArray(new String[1]);
}

