@Override
public Set<String> listAvailableCurrencies() {
  Set<String> currencies = new HashSet<String>();
  for(String from : rates.keySet()) {
    currencies.add(from);
    for(String to : rates.get(from).keySet()) {
      currencies.add(to);
    }
  }
  return currencies;
}

